// #region Local Imports
import { Http } from "../.."; // #endregion Local Imports
// #region Interface Imports

// #endregion Interface Imports
export const PlanetaryService = {
  GetPlanetImage: async payload => {
    let response;

    try {
      response = await Http.Request("GET", "/planetary/apod", payload.params);
    } catch (error) {
      response = {
        copyright: "",
        date: "",
        explanation: "",
        hdurl: "",
        service_version: "",
        title: "",
        url: ""
      };
    }

    return response;
  }
};
